            html+='<a target="_blank" href="'+item.auctionUrl+'" class="btn btn-danger btn-buy">购买</a>';
            html+='</div>';
            html+='</div>';
            return html;
        }

        var warpHtml="";
        for(var i= 0;i<json.length;i++){
            var item=json[i];
            warpHtml+=createItem(item);
        }

        $("#wrap").html(warpHtml);
    });
</script>
